style.css:
@-moz-document domain("facebook.com"), domain("www.facebook.com") {
/* Thêm hình nền tùy chỉnh */
  body {
    background-image: url('https://scontent.fsgn5-15.fna.fbcdn.net/v/t1.15752-9/456280544_302004516336840_5400264156743851376_n.jpg?_nc_cat=111&ccb=1-7&_nc_sid=9f807c&_nc_ohc=cgULa-rrjtMQ7kNvgHnQXEn&_nc_ht=scontent.fsgn5-15.fna&oh=03_Q7cD1QHrHdrSRl8QQc4xw8J5lqYYTAo81e7q4vHNFM5r1cJ5VA&oe=66F1818B');
    background-size: cover; /* Hình nền sẽ phủ kín toàn bộ trang */
    background-attachment: fixed; /* Hình nền cố định khi cuộn trang */
    background-repeat: no-repeat; /* Không lặp lại hình nền */
  }

  /* Đổi màu chữ thành màu đen */
  .userContent, ._5pbx, ._5pbx p, ._5pbx span, ._5pbx div,
  ._5pbx a, ._6m6, ._6m7, ._6qw4, ._6qw5, ._6qw6, ._6qw7,
  ._6qw8, ._6qw9, ._6qwa, ._6qwb, ._6qwc, ._6qwd, ._6qwe,
  ._6qwf, ._6qwg, ._6qwh, ._6qwi, ._6qwj, ._6qwk, ._6qwl {
    color: #000 !important; /* Đặt màu chữ thành đen */
  }

  /* Đặt nền cho các khu vực có văn bản để đảm bảo đọc dễ dàng */
  ._1c3l, ._5pcb, .userContentWrapper, ._4-u2 {
    background-color: rgba(255, 255, 255, 0.8) !important;
    border-radius: 8px; /* Góc bo tròn cho nền */
    padding: 10px; /* Thêm khoảng trống xung quanh văn bản */
  }
}
